package problem1044

import (
	"strings"
	"testing"

	"github.com/stretchr/testify/assert"
)

// tcs is testcase slice
var tcs = []struct {
	S   string
	ans string
}{

	{
		"",
		"babaaaabbbbabbababbabbbababbbb",
	},

	{
		"",
		"akyj",
	},

	{
		"banana",
		"ana",
	},

	{
		"abcd",
		"",
	},

	// 可以有多个 testcase
}

func Test_longestDupSubstring(t *testing.T) {
	ast := assert.New(t)

	for _, tc := range tcs {
		ans := longestDupSubstring(tc.S)
		ast.Equal(len(tc.ans), len(ans), "输入:%v", tc)
		ast.True(isDupsub(tc.S, ans) && isLongest(tc.S, ans))
	}
}

func isDupsub(S, sub string) bool {
	i := strings.Index(S, sub)
	if i == -1 || strings.Index(S[i+1:], sub) == -1 {
		return false
	}
	return true
}

func isLongest(S, sub string) bool {
	for b := 'a'; b <= 'z'; b++ {
		if isDupsub(S, sub+string(b)) ||
			isDupsub(S, string(b)+sub) {
			return false
		}
	}
	return true
}

func Benchmark_longestDupSubstring(b *testing.B) {
	for i := 0; i < b.N; i++ {
		for _, tc := range tcs {
			longestDupSubstring(tc.S)
		}
	}
}
